'''''Tolkienpodden''''' is a Swedish [[J.R.R. Tolkien|Tolkien]]-related podcast hosted by [[Adam Westlund De La Torre]], [[Elisabet Bergander]] and [[Daniel Möller]]. The podcast has been released monthly since 2017. Every episode covers a different Tolkien-related subject.


